C_DEPLOYABLE_CAMERA:"Kamera, die gegnerische Bewegungen in einem breiten Winkel vor der Kamera erkennt und meldet. Die Bedeutung von Informationen sollte nicht unterschätzt werden!",BFH_ID_P_IDESC_DINO_MASK:"Mit dieser Dinosaurier-Gummimaske kannst du dir perfekt deine Beute schnappen. Glückwunsch, du gehörst jetzt zur Elite!",BFH_ID_P_IDESC_FLASHBANG:"Die M84-Blendgranate erzeugt einen grellen Explosionsblitz und enormen Lärm. Diese können Gegner verwirren und ablenken.",BFH_ID_P_IDESC_GAS_GRENADE:"Zeitzündergranate, die eine der Eindämmung von Ausschreitungen dienende Tränengaswolke verströmt. Sicht und Präzision vom Tränengas Betroffener werden stark beeinträchtigt, ihre Schadensanfälligkeit wird deutlich erhöht.",BFH_ID_P_IDESC_GAS_MASK:"Die Gasmaske wirkt den Effekten der Gasgranate entgegen und blockt zudem auch die Wirkung einiger Umwelteinflüsse.",BFH_ID_P_IDESC_GRAPPLEHOOK:"Das Abfeuern des Kletterhakens auf einen flachen Vorsprung erzeugt ein Kletterseil zur Oberkante des Vorsprungs. Seile können durch Schnitte oder Schüsse zerstört werden.",BFH_ID_P_IDESC_INCENDIARY_DEVICE:"Eine Brandsatz-Handgranate, die eine Feuerwolke freisetzt. Mit ihrer Hilfe können Wege vorübergehend blockiert oder Gegner aus der Deckung geholt werden.",BFH_ID_P_IDESC_LASER_TRIPMINE:"Sprengmine, die beim Durchschreiten des Lasers gezündet wird. Platzierbar auf sämtlichen erreichbaren Oberflächen. Kann von Agents bei rechtzeitiger Sichtung entschärft werden.",BFH_ID_P_IDESC_M18:"Eine Handgranate mit Zeitzünder, die eine Rauchwolke freisetzt und jegliche Sichtungsversuche blockiert.",BFH_ID_P_IDESC_M67:"Hochexplosive Splittergranate mit mittlerem Sprengradius, die Infanterie und Fahrzeugen erheblichen Schaden zufügt.",BFH_ID_P_IDESC_M79:"Dieser aus alten Armeebeständen stammende Hinterlader-Granatwerfer wurde vermutlich nicht legal erworben. Er verfeuert eine gegen leichte Fahrzeuge und Agents effektive, hochexplosive 40mm-Granate.",BFH_ID_P_IDESC_MEDKIT:"Stationierbares Erste-Hilfe-Pack. Verbündete in der Nähe werden selbst im Kampf langsam geheilt, bis ihre volle Gesundheit wiederhergestellt ist. Träger eines Erste-Hilfe-Packs können zur Heilung mit einem Teamkameraden interagieren.",BFH_ID_P_IDESC_MOLOTOV:"Eine zerbrechliche Glasflasche mit einer entzündlichen Flüssigkeit (z.B. Benzin). Der Molotow-Cocktail ist eine improvisierte Brandwaffe, die Gegner nicht sofort vernichten, sondern ihnen in erster Linie den Weg abschneiden soll.",BFH_ID_P_IDESC_NOGADGET1:fn,BFH_ID_P_IDESC_NOGADGET2:fn,BFH_ID_P_IDESC_REPAIR:"Ein tragbarer autogener Schweiß- und Schneidbrenner, der verbündete Fahrzeuge repariert und feindlichen Fahrzeugen und Agents Schaden zufügt.",BFH_ID_P_IDESC_REVIVE:"Die Adrenalinspritze kann bewusstlose Teamkameraden wieder in den Kampf zurückholen. Wird die Adrenalinspritze vorbereitet, steigen Teamkameraden mit höherer Gesundheit wieder ein. Ist sie vorbereitet, kann sie Gegner auch überwältigen.",BFH_ID_P_IDESC_SABOTAGE:"Sabotagebombe, die Fahrzeuge, Ziele und Interaktionspunkte in Bomben verwandelt. Detoniert bei Einsatz durch einen Gegner. Achte auf das blinkende Licht! Kann mit dem Werkzeug entschärft, abgeschossen oder gesprengt werden.",BFH_ID_P_IDESC_STEALTHTRAINING:"Agents mit Tarntraining können sich leise bewegen. Die Schritte der Agents sind leiser, und auch Aktionen wie das Öffnen von Türen verursachen weniger Geräusche.",BFH_ID_P_IDESC_STUNTDRIVER:"Der Stuntfahrer verleiht jedem Bodenfahrzeug einen Nitro-Boost und ermöglicht dem Fahrer in Gefahrensituationen eine schnelle Beschleunigung. Stuntfahrer erleiden zudem bei Kollisionen mit Hindernissen geringeren Schaden.",BFH_ID_P_IDESC_SURVIVALIST:"Du erhältst die Möglichkeit, dich nach einem eigentlich tödlichen Unfall oder Sprengangriff wiederzubeleben. Wirkt nicht bei tödlichen Verletzungen durch Kugeln, Feuer, Gas, Nahkampfangriffe, Elektroschocker oder Stürze.",BFH_ID_P_IDESC_TASER_GUN:"Mit dem T62 CEW kannst du Gegner aus kurzer Distanz nicht-tödlich überwältigen. Du kannst außer Gefecht gesetzte Gegner verhören, um herauszufinden, wo sich ihre nahen Teamkameraden befinden. (Nur Multiplayer)",BFH_ID_P_IDESC_TRACKING_DART:"Wenn du den Zielpfeil auf gegnerische Spieler und Fahrzeuge feuerst und ihn an ihnen befestigst, werden sie in der Spielwelt und auf deiner Minimap gesichtet. Raketenwerfer können das Ziel dann erfassen.",BFH_ID_P_IDESC_WOLF_MASK:"Diese Wolfs-Gummimaske eignet sich perfekt für deine Raubzüge. Glückwunsch, du gehörst jetzt zur Elite!",BFH_ID_P_IDESC_ZIPLINE:"Die Seilrutsche erzeugt ein straffes Seil zwischen zwei Punkten. Springe an einer beliebigen Stelle zum Seil, um dich schnell hinunterzubewegen. Schalte gegnerische Seilrutschen durch Zerschneiden oder Beseitigen der Halterungen aus.",BFH_ID_P_INAME_40MM:"M320 He",BFH_ID_P_INAME_ACB90:"Acb-90",BFH_ID_P_INAME_AMMO:"Munitionskiste",BFH_ID_P_INAME_ARMORINSERT:"Panzerung",BFH_ID_P_INAME_BALLISTIC_SHIELD:"Ballistikschild",BFH_ID_P_INAME_BAT:"Baseballschläger",BFH_ID_P_INAME_BAYONETT:"Messer",BFH_ID_P_INAME_BAYONETT_GOLD:"Messer (Gold)",BFH_ID_P_INAME_BEACON:"Satellitentelefon",BFH_ID_P_INAME_BLACKJACK:"Totschläger",BFH_ID_P_INAME_BPKNIFE2:"Späher",BFH_ID_P_INAME_BPKNIFE2_GOLD:"Scout (Gold)",BFH_ID_P_INAME_BPKNIFE3:"Grabendolch",BFH_ID_P_INAME_BPKNIFE3_GOLD:"Graben (Gold)",BFH_ID_P_INAME_BPKNIFE4:"Kohlefaser",BFH_ID_P_INAME_BPKNIFE5:"Survival",BFH_ID_P_INAME_BPKNIFE5_GOLD:"Survival (Gold)",BFH_ID_P_INAME_BPKNIFE6:"Bowie",BFH_ID_P_INAME_BPKNIFE7:"Stiefel",BFH_ID_P_INAME_BPKNIFE7_GOLD:"Stiefel (Gold)",BFH_ID_P_INAME_BPKNIFE8:"Seal",BFH_ID_P_INAME_BPKNIFE8_GOLD:"Seal (Gold)",BFH_ID_P_INAME_BREACHHAMMER:"Hammer",BFH_ID_P_INAME_BREACHHAMMER_GOLD:"Hammer (Gold)",BFH_ID_P_INAME_C4:"C4-Sprengsatz",BFH_ID_P_INAME_COLLAPSBATON:"Knüppel",BFH_ID_P_INAME_COLLAPSBATON_GOLD:"Knüppel (Gold)",BFH_ID_P_INAME_CROWBAR:"Brecheisen",BFH_ID_P_INAME_CROWBAR_GOLD:"Brecheisen (Gold)",BFH_ID_P_INAME_DECOY:"Falle",BFH_ID_P_INAME_DEFIB:"Defibrillator",BFH_ID_P_INAME_DEPLOYABLE_CAMERA:"Kamera",