AHA_SP_ASSAULT:"Dawes weiß, dass es für ihn um Leben und Tod geht. Aber seinen Aufenthaltsort hat er trotzdem preisgegeben. Warum bloß?",BFH_ID_RP_LEVELDESC_OMAHA_SP_CHOPSHOP:"Tyson und Khai haben ein paar Hinweise auf Dawes' neue Geschäfte gefunden. Diese Hinweise sollten nun genauer untersucht werden.",BFH_ID_RP_LEVELDESC_OMAHA_SP_COPFANTASY:"Captain Dawes mag keine misslungenen Einsätze, und der letzte Einsatz war mächtig misslungen. Seine Leute gehen ihm aus dem Weg, wo sie nur können. Aber das gelingt nicht jedem.",BFH_ID_RP_LEVELDESC_OMAHA_SP_DEALGONEBAD:"Khai war die letzten Wochen verletzt außer Gefecht, und Dawes hat nur in seinem Büro gehockt. Nachdem der Captain fast schon wieder einen Officer verloren hätte, plant er vorsichtig sein weiteres Vorgehen.",BFH_ID_RP_LEVELDESC_OMAHA_SP_DESERT:"Mit Khais Handy lässt sich das Geld vermutlich relativ mühelos an seinen Zielort verfolgen. Aber es dann auch zu holen, dürfte mit etwas mehr Mühe verbunden sein.",BFH_ID_RP_LEVELDESC_OMAHA_SP_ESCAPE:"Es ist jetzt schon fast drei Jahre her, dass Nick Mendoza wegen eines Verbrechens verurteilt wurde, das er nicht begangen hatte. Die Wunden sind noch immer tief.",BFH_ID_RP_LEVELDESC_OMAHA_SP_EVERGLADES:"Miami leidet unter einer regelrechten Kokainflut, und Leo “Sting“ Ray weiß, wer dafür verantwortlich ist. Mal sehen, was der Bastard weiß.",BFH_ID_RP_LEVELDESC_OMAHA_SP_HEIST:"An den Brecher zu kommen, war der reinste Albtraum. Einen millionenschweren Safe in der Firmenzentrale eines privaten Sicherheitsunternehmens zu knacken, wird sicher nicht viel leichter.",BFH_ID_RP_LEVELDESC_OMAHA_SP_HOLLYWOODHILLS:"In Kangs Laden ließ sich nichts Brauchbares zu Dawes finden. Aber vielleicht findet Boomer Hinweise in den heruntergeladenen Dateien.",BFH_ID_RP_LEVELDESC_OMAHA_SP_PROLOGUE:j,BFH_ID_RP_LEVELDESC_OMAHA_SP_THETURN:"Eins steht fest: Detective Carl Stoddard hat Dreck am Stecken. Aber wer noch mit von der Partie ist und ihm Rückendeckung gibt, ist unklar.",BFH_ID_RP_LEVELNAME_